const setSounds = () => {

    const sounds = [{ "inv1": "" }, { "inv2": "" }, { "ship1": "" }, { "ship2": "" }, { "expl": "" }, { "kill": "" }, { "shoot": "" }];
    sounds.forEach(sound => {
        const audioId = Object.keys(sound)[0];
        const audioSrc = Object.values(sound)[0];
        const audio = `<audio id="${audioId}" src="data:audio/wav;base64,${audioSrc}" allow="autoplay" />`;
        $('body').append(audio);
        // $(audio).insertAfter(invaders);
    });
};

